import React, {Component} from 'react';
import { Link } from 'react-router-dom';

function FavoriteItem (item_id) {
        console.log(item_id)
        const URL = `http://127.0.0.1:8080/api/item/id/${item_id}`
        fetch(URL)
        .then(response => response.json())
        .then(data => {
            const item = data[0]
            return (
                <Link to={`/item/${item.name}`} className='items-card' >
                    <img src={item.img}/>
                </Link>
            )
        })
        .catch(err => console.log(err))

}

export {FavoriteItem}
